%[text] # **Graphics Hierarchy Chart Examples**
%[text] **Overview**
%[text] The `GraphicsHierarchyChart` visualizes the MATLAB graphics hierarchy descending from a given graphics object using a [`graph`](<matlab: doc("graph")>) plot. This chart is useful when debugging more complex visualizations or application components. 
%[text] The chart uses a recursive algorithm ([`kids2graph`](<matlab: edit("kids2graph")>)) to find the descendants of the given graphics object representing the root node of the tree. The chart also provides an option to include graphics objects with hidden handles. By default, only descendants with visible handles are shown. 
%[text] We can use the convenience function [`plotkids`](<matlab: edit("plotkids")>) to create the chart.
%[text] ![GraphicsHierarchyChart.png](text:image:12c4)
%[text] **Documentation**
%[text] - [`graph`](<matlab: doc("graph")>): Graph with undirected edges
%[text] - [`plot`](<matlab: doc("graph/plot")>): Plot graph nodes and edges
%[text] - [`plotkids`](<matlab: edit("plotkids")>): Convenience function for creating a graphics hierarchy chart
%[text] - [`kids2graph`](<matlab: edit("kids2graph")>): Construct a graph listing the descendants of the given graphics object \
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Visualize data using a scatter plot.
%[text] Generate random data.
rng( "default" )
n = 100;
x = rand( n, 1 );
y = rand( n, 2 );
%[text] Create the scatter plot.
f = figure; %[output:7b38e721]
scatter( x, y, "filled" ) %[output:7b38e721]
legend( "A", "B" ) %[output:7b38e721]
%%
%[text] ## Visualize the graphics hierarchy under the figure.
fchart = exampleFigure( "Name", "GraphicsHierarchyChart Example" ); %[output:56baaa79]
GHC = plotkids( f, "Parent", fchart ); %[output:56baaa79]
%%
